import { Container, Typography } from '@material-ui/core';
import { FC } from 'react';
import { Header } from '../components/Header';

const Home: FC = () => {
  return (
    <>
      <Header />
      <Container maxWidth="md">
        <figure></figure>
        <Typography variant="h6" component="h1">
          We all dream of being in other places
        </Typography>
      </Container>
    </>
  );
};

export default Home;
